Odnoklassniki is a social network with millions of users around the world. In OK you can call friends, livestream, send stickers and gifts, find new friends in groups and share moments. Have fun listening to music, watching videos and playing games!

HOBBIES
— New service! Cooking, DIY, gardening, traveling, fishing, fashion, cars and pets - you can find all the most interesting things about your hobby in OK;
— Watch thousands of videos about your favorite topic;
— Haven’t found your hobby? Use the search bar, OK has millions of interesting posts.

MOMENTS
— Share your moments! Post photos and videos that will disappear after 24 hours;
— Use frames, stickers and animated texts to make your moments look even better;
— Add any links to the moments.

PRODUCTS
— Favorite AliExpress is in OK now, buy millions of products without extra charges;
— Get inspired, choose goods, discuss it with friends and buy easily;
— Buyer protection guaranteed.

COMMUNICATION
